/**
 * Test class for testing string converter.
 */ export class ToStringClass {
    x;
    y;
    constructor(/** A value */ x, /** Another value */ y){
        this.x = x;
        this.y = y;
    }
    toString() {
        return [
            this.x,
            this.y
        ].join('-');
    }
    static fromString(value) {
        const [x, y] = value.split('-');
        return new ToStringClass(x, y);
    }
}
